// Detect and fix file binary data
// Webhook stores files with dynamic property names, we normalize them here
const items = $input.all();

for (const item of items) {
  if (!item.binary) {
    throw new Error('No binary data found. Please upload a file.');
  }

  // Get the first binary property (whatever the webhook named it)
  const binaryKeys = Object.keys(item.binary);
  if (binaryKeys.length === 0) {
    throw new Error('Binary object exists but is empty');
  }

  const firstKey = binaryKeys[0];
  let binaryData = item.binary[firstKey];

  // Fix MIME type and extension based on filename
  const fileName = binaryData.fileName || '';

  if (fileName.endsWith('.xlsx')) {
    binaryData.mimeType = 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet';
    binaryData.fileExtension = 'xlsx';
  } else if (fileName.endsWith('.xls')) {
    binaryData.mimeType = 'application/vnd.ms-excel';
    binaryData.fileExtension = 'xls';
  } else {
    throw new Error(`Invalid file type: ${fileName}. Please upload .xlsx or .xls files only.`);
  }

  // Ensure binary data is available as 'data' for downstream nodes
  if (firstKey !== 'data') {
    item.binary.data = binaryData;
  }
}

return items;

// Automatically infer schema from Excel data
// Generates Oracle table name and column definitions
const rows = $input.all().map(i => i.json);
if (!rows.length) throw new Error('Excel file is empty');

// Sanitize column names for Oracle compatibility
const sanitize = k => k.trim()
  .replace(/[^a-zA-Z0-9]/g, '_')
  .replace(/^_+|_+$/g, '')
  .toUpperCase();

const sample = rows[0];
const columns = [];

// Infer data types from first row
for (const [k, v] of Object.entries(sample)) {
  let type = 'VARCHAR2(4000)';
  if (typeof v === 'number') {
    type = 'NUMBER';
  } else if (v && !isNaN(Date.parse(v))) {
    type = 'DATE';
  }
  columns.push({ name: sanitize(k), type });
}

// Clean all rows with sanitized column names
const cleanRows = rows.map(r => {
  const o = {};
  for (const [k, v] of Object.entries(r)) {
    o[sanitize(k)] = v;
  }
  return o;
});

// Generate unique table name with timestamp
const tableName = `UPLOAD_EXCEL_${new Date().toISOString().replace(/[-:.TZ]/g, '')}`;

return [{ json: { tableName, columns, rows: cleanRows } }];

