=DECLARE
  v_owner VARCHAR2(128);
  v_profile_name VARCHAR2(128) := '{{ $json.selectAIConfig.profile_name }}';
  v_table_name VARCHAR2(128) := '{{ $json.selectAIConfig.table_name }}';
BEGIN
  -- Get current schema
  SELECT SYS_CONTEXT('USERENV', 'CURRENT_USER')
  INTO v_owner
  FROM dual;

  -- Drop profile if it already exists
  BEGIN
    DBMS_CLOUD_AI.DROP_PROFILE(profile_name => v_profile_name);
  EXCEPTION
    WHEN OTHERS THEN
      NULL; -- Ignore if profile doesn't exist
  END;

  -- Create Select AI profile with enforced object list
  DBMS_CLOUD_AI.CREATE_PROFILE(
    profile_name => v_profile_name,
    attributes => JSON_OBJECT(
      'provider' VALUE '{{ $json.selectAIConfig.provider }}',
      'azure_resource_name' VALUE '{{ $json.selectAIConfig.azure_resource_name }}',
      'azure_deployment_name' VALUE '{{ $json.selectAIConfig.azure_deployment_name }}',
      'credential_name' VALUE '{{ $json.selectAIConfig.credential_name }}',
      'object_list' VALUE JSON_ARRAY(
        JSON_OBJECT(
          'owner' VALUE v_owner,
          'name' VALUE v_table_name
        )
      ),
      'enforce_object_list' VALUE TRUE
    )
  );
END;

